public class User_Tester extends AbstractTester {

    public static void main(String[] args) throws InvalidDataException, JsonProcessingException {
        new User_Tester().run();
    }

    @Override
    protected void preExecution() {
        OneProperties.DATABASE__HOST.setValue("192.168.2.10");
    }

    @Override
    protected void execution() {
        insertMany();
    }

    void insertOne() {

        final User user = new User();
        user.setAvatar("data:image/png;base64,");
        user.setActive(Boolean.TRUE);
        user.setFirstName("Admin");

        user.setEmail("admin@makesystem.com");
        user.setLogin("admin");
        user.setPassword(MD5.toMD5("admin"));
        user.setType(UserType.MAKESYSTEM);

        final UserService userService = new UserService();
        try {
            userService.insert(user);
            System.out.println("AQUI");
        } catch (Throwable ex) {
            ex.printStackTrace();
        }

    }

    void insertMany() {

        final Collection<User> users = new LinkedList<>();

        for (int i = 0; i < 10; i++) {

            final User user = new User();
            //user.setAvatar("data:image/png;base64,");
            user.setActive(Boolean.TRUE);
            user.setFirstName("User " + i);

            user.setEmail("user." + i + "@makesystem.com");
            user.setLogin("user" + i);
            user.setPassword(MD5.toMD5("user" + i));
            user.setType(UserType.MAKESYSTEM);

            users.add(user);
        }
        final UserService userService = new UserService();
        try {
            userService.insert(users);
        } catch (Throwable ex) {
            ex.printStackTrace();
        }

    }

    @Override
    protected void posExecution() {
    }

}
